import { useState, useEffect } from "react";

const useFetch = (url) => {
    
  const [data, setData] = useState(null);

    const getFetch = async(url)=>{
        const api = await fetch(url);
        const response = await api.json();
        console.log(url)
        setData(response)
        
    }

  return [data , getFetch];
};

export default useFetch;
